import React from 'react';
import './Dividers.css';
import Divider from '../Divider/Divider';

const Dividers = (props, selected) => {
  let selectedD = 'divider';
  if(props.selected !== undefined) {
    selectedD = props.selected;
    console.log(selectedD);
    selectedD = 'divider active';
  }
  return (
    <div className="dividers">
      {props.dividers.map(function (value, index) {
          return <Divider divider={value} selected={props.currentDivider} items={props.items} key={index} onDividerClick={props.onDividerClick}></Divider>;
      })}
    </div>
  );
}

export default Dividers;
